    return response.always { result in
        let status: HTTPStatus
        switch result {
        case .success(let response):
            status = response.status
        case .failure:
            status = .internalServerError
        }
        self.updateMetrics(
            for: request,
            path: path,
            startTime: startTime,
            statusCode: status.code
        )
    }
}

